Defendant Kurstyn L Bieneman in court, in custody, with attorney Joseph Smith.   Brian J. Juech appeared for the State of Wisconsin. 
Defendant enters a plea of no contest to count 1 with the penalty enhancer (repeater allegation) dismissed. 
Court conducted plea colloquy with the defendant. 
Court found the defendant guilty of count 1 with the penalty enhancer (repeater allegation) dismissed. 
Court dismissed and read-in count 2. 

The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

1 YEAR JAIL (Straight time), 

TERM OF PROBATION:  16 MONTHS; Probation may be transferred to Racine or Kenosha County (whichever county defendant resides in). Defendant to be released and must contact Department of Corrections within 24 hours of release.

CONDITIONS OF EXTENDED SUPERVISION:  
*AODA Assessment and follow through with any treatment recommended;
*Follow through with any treatment and/or counseling recommended by Agent;
*No contact with the victim or her residence;
*Defendant to provide DNA sample, if not yet provided, immediately upon going back to jail and prior to being released today.
*Mental Heath evaluation and treatment deemed appropriate.
*Criminal Thinking Course or Cognitive Thinking Course if deemed appropriate by agent;

CONDITION TIME: 30 Days non working hours (Huber), STAYED; to be used at agent's discretion.    

RESTITUTION: Zero (None requested);

COURT COSTS:  278.00 (includes $10.00 DRGOD assessment) to be paid as a condition of extended supervision;

DNA SURCHARGE:  $250.00 to be paid as a condition of extended supervision;

Felony warnings, voting rights and firearms warnings given.
